// import logo from './logo.svg';
// import Tabs from 'react-bootstrap/Tabs'
// import Tab from 'react-bootstrap/Tab'
import "../styles/ThreeTabs.css"
// import CategoriesTable from './CategoryTable';
// import BooksTable from './BooksTable';
// import AuthorsTable from './AuthorsTabel';

function ThreeTabs() {
  return (
    <div className="">
      <ul class="nav nav-tabs">
        <li class="active"><a data-toggle="tab" href="#home">Categories</a></li>
        <li><a data-toggle="tab" href="#menu1">Books</a></li>
        <li><a data-toggle="tab" href="#menu2">Authors</a></li>
      </ul>

      <div class="tab-content">
        <div id="categories" class="tab-pane fade in active">
          {/* <h3>C</h3> */}
          <p>Some content.</p>
        </div>
        <div id="menu1" class="tab-pane fade">
          <h3>Menu 1</h3>
          <p>Some content in menu 1.</p>
        </div>
        <div id="menu2" class="tab-pane fade">
          <h3>Menu 2</h3>
          <p>Some content in menu 2.</p>
        </div>
      </div>
    </div>
  );
}

export default ThreeTabs;
